import React from "react";
import "../stylesheets/App.scss";
import getDataFromAPI from "../services/api";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      series: [],
    };

    getDataFromAPI().then((data) => {
      console.log(data);
      this.setState({
        series: data,
      });
    });
  }

  render() {
    return (
      <div>
        <p>Hola Mundo</p>
      </div>
    );
  }
}

export default App;
